import '../Estilos/PagInicio.css';
import  logos from '../Imagenes/Designer.jpeg';
import lupa from '../Imagenes/lupita.png';
const pagInicio = () => {
    return(
        <header>
            <div class="logo">
                <img src={logos} alt="Logo"/>
            </div>
            <input type="text" placeholder='Buscar'/>
        </header>


    );
}

export default pagInicio;
